import React from "react";

const BuyHistory = ({ deals, actualUser }) => {
  return (
    <div
      style={{
        position: "absolute",
        left: "25%",
        top: "50%",
        transform: "translate(-50%, -50%)",
        background: "black",
      }}
      className="card col-md-6 offset-md-3 offset-md-3"
    >
      <table className="table table-dark">
        <thead>
          <tr>
            <th scope="img">Photo</th>
            <th scope="col">C.C</th>
            <th scope="col">Fuel</th>
            <th scope="col">HP</th>
            <th scope="col">Price</th>
            <th scope="col">Year</th>
          </tr>
        </thead>
        <tbody>
          {deals.map((deal) =>
            deal.buyId === actualUser ? (
              <tr key={deal.id}>
                <td>
                  <img
                    src={require(`./${deal.picture}`)}
                    alt=""
                    style={{ border: 3, height: 200, width: 300 }}
                  />
                </td>
                <td>{deal.cc}</td>
                <td>{deal.fuel} </td>
                <td>{deal.hp}</td>
                <td>{deal.price}</td>
                <td>{deal.year}</td>
              </tr>
            ) : (
              <tr></tr>
            )
          )}
        </tbody>
      </table>
    </div>
  );
};

export default BuyHistory;
